function Buttons() {
  const buttons = {
    C: { name: "C", value: "C" },
    delete: { name: "delete", value: "delete" },
    display: { name: "display", value: "display" },
    OFF: { name: "OFF", value: "OFF" },
    seven: { name: "7", value: 7 },
    eight: { name: "8", value: 8 },
    nine: { name: "9", value: 9 },
    divide: { name: "/", value: "/" },
    four: { name: "4", value: 4 },
    five: { name: "5", value: 5 },
    six: { name: "6", value: 6 },
    multiply: { name: "*", value: "*" },
    one: { name: "1", value: 1 },
    two: { name: "2", value: 2 },
    three: { name: "3", value: 3 },
    minus: { name: "-", value: "-" },
    zero: { name: "0", value: 0 },
    dot: { name: ".", value: "0" },
    equal: { name: "=", value: "=" },
    plus: { name: "+", value: "+" },
  };

  console.log(buttons.multiply.name);

  return (
    <div className="btns">
      {buttons.map((btn) => {
        return <button value={btn.value}>{btn.name}</button>;
      })}
    </div>
  );
}

export default Buttons;
